import { Navigate, Outlet, useNavigate } from "react-router-dom"
export const ProtectedRoutes = ({isLogged}) =>{
    const navigate = useNavigate()
    if(!isLogged){
        return <Navigate to="/"/>
    }
    return <Outlet/>
}
